import React from 'react';
const Adminnav = () => {
    return ( 
        <div className="mt-4 container">
       <ul class="nav nav-tabs">
       <li class="nav-item">
        <a class="nav-link active" href="#">Active</a>
       </li>
   
       </ul>
        </div>
     );
}
 
export default Adminnav;
